import axios from "axios";

async function fetchApi(data) {
  let configObj = {
    url:
      process.env.REACT_APP_DEVELOPMENT_URL +
      process.env.REACT_APP_DEVELOPMENT_API_KEY,
    ...data,
  };
  try {
    let result = await axios(configObj);
    return result;
  } catch (error) {
    return error;
  }
}

export default fetchApi;
